outhex = """"""
output = ""
rev = 31
for x in range(len(outhex)):
    if (x%128 == 0):
        y=0
        z = 0
        output += str(rev) + ":{"
        for y in range(0,6,2):
            pos = x + y
            output += str(z) + ":" + str(int(outhex[pos:pos+2],16)) + ","
            z+=1
        output += "},"
        rev +=1
        
print(output)
